import React, { useState } from "react";
import axios from "axios";
import "./registration.css";

export default function Registration() {
    const [selectedDate, setSelectedDate] = useState("");
    const [inputValue, setInputValue] = useState("");
    const [errorMessage, setErrorMessage] = useState("");
    const [inputEmail, setEmailValue] = useState("");
    const [errorMesage, setErrorMesage] = useState("");
    const [password, setPassword] = useState("");
    const [verifyPassword, setVerifyPassword] = useState("");
    const [errorMess, setErrorMess] = useState("");

    const handleDateChange = (e) => {
        const selectedDateValue = e.target.value;
        const [day, month, year] = selectedDateValue.split('-');
        const isoDate = `${year}-${month}-${day}`;
        setSelectedDate(isoDate);
    };


    const handleChange = (e) => {
        const value = e.target.value;

        if (/^\d*$/.test(value) && value.length <= 8) {
            setInputValue(value);
            setErrorMessage("");
        } else if (value.length > 8) {
            setErrorMessage("Max of 8 numbers only");
        }
    };

    const handleChange3 = (e) => {
        const value = e.target.value;
        setEmailValue(value);
        if (value === "") {
            setErrorMessage("");
        } else if (/^[^\s@]+@[^\s@]+\.[^\s@]+$/.test(value)) {
            setEmailValue(value);
            setErrorMesage("");
        } else {
            setErrorMesage("Enter in email format");
        }
    };

    const handleChange2 = (e) => {
        const { id, value } = e.target;

        if (id === "password") {
            setPassword(value);
            if (verifyPassword !== "" && value !== verifyPassword) {
                setErrorMess("Passwords do not match");
            } else {
                setErrorMess("");
            }
        } else if (id === "verifyPassword") {
            setVerifyPassword(value);
            if (value === "" && password !== "") {
                setErrorMess("");
            } else if (password !== "" && value !== password) {
                setErrorMess("Passwords do not match");
            } else {
                setErrorMess("");
            }
        }
    };

    const handleSubmit = async (event) => {
        event.preventDefault();

        if (password !== verifyPassword) {
            setErrorMess("Passwords do not match");
            return;
        }

        try {
            const res = await axios.post("http://localhost:6000/api/users/register", {
                firstName: event.target.elements.firstName.value,
                lastName: event.target.elements.lastName.value,
                email: inputEmail,
                phoneNumber: inputValue,
                dateOfBirth: selectedDate,
                password: password,
            });
            console.log(res.data); // Handle successful registration
        } catch (err) {
            console.error(err.response.data);
            setErrorMess(err.response.data.message);
        }
    };

    return (
        <>
            <div className="form-container">
                <form onSubmit={handleSubmit}>
                    <h1>Registration Page</h1>
                    <div className="form-el">
                        <label className="label">First Name:</label>
                        <input type="text" className="input" name="firstName" />
                    </div>
                    <br />
                    <div className="form-el">
                        <label className="label">Last Name:</label>
                        <input type="text" className="input" name="lastName" />
                    </div>
                    <br />
                    <div className="form-el">
                        <label className="label">Email ID:</label>
                        <input
                            className="input"
                            type="text"
                            value={inputEmail}
                            onChange={handleChange3}
                            placeholder="Enter email"
                        />
                        {inputEmail !== "" && errorMesage && (
                            <div style={{ color: "red" }}>{errorMesage}</div>
                        )}
                    </div>
                    <br />
                    <div className="form-el">
                        <label className="label">Phone Number:</label>
                        <input
                            className="input"
                            type="text"
                            value={inputValue}
                            onChange={handleChange}
                            placeholder="Enter up to 8 numbers"
                        />
                        {errorMessage && <div style={{ color: "red" }}>{errorMessage}</div>}
                    </div>
                    <br />
                    <div className="form-el">
                        <label className="label">Date of Birth:</label>
                        <input
                            className="date"
                            type="date"
                            value={selectedDate}
                            onChange={handleDateChange}
                        />
                    </div>
                    <br />
                    <div className="form-el">
                        <label className="label">Password:</label>
                        <input
                            className="input"
                            type="password"
                            id="password"
                            value={password}
                            onChange={handleChange2}
                        />
                    </div>
                    <br />
                    <div className="form-el">
                        <label className="label">Verify password:</label>
                        <input
                            className="input"
                            type="password"
                            id="verifyPassword"
                            value={verifyPassword}
                            onChange={handleChange2}
                        />
                        {errorMess && <div style={{ color: "red" }}>{errorMess}</div>}
                    </div>
                    <br /> <br />
                    <div>
                        <button className="button" type="submit">Submit</button>
                        <br /> <br />
                    </div>
                </form>
            </div>
        </>
    );
};
